import React from 'react';
import { FaChartPie } from 'react-icons/fa';

function Dashboard() {
  // Dummy data for demonstration
  const complianceRate = 70;
  const rejectionRate = 30;

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <h1 className="text-3xl font-bold text-green-600 mb-6 flex items-center">
        <FaChartPie className="mr-2" /> Compliance Dashboard
      </h1>
      <div className="bg-white shadow rounded-lg p-6">
        <div className="flex justify-around">
          <div className="text-center">
            <p className="text-4xl font-bold text-green-600">{complianceRate}%</p>
            <p className="text-gray-600">Compliant</p>
          </div>
          <div className="text-center">
            <p className="text-4xl font-bold text-red-600">{rejectionRate}%</p>
            <p className="text-gray-600">Rejected</p>
          </div>
        </div>
        <div className="mt-6">
          <p className="text-gray-700">Detailed trends and analytics coming soon...</p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
